    for subject, triple_list in subject_map.items():
        sentence = subject
        properties = []
        for triple in triple_list:
            if triple.predicate == "discoverer":
                properties.append(f"was discovered by {triple.object}")
            elif triple.predicate == "epoch":
                properties.append(f"has an epoch of {triple.object}")
            elif triple.predicate == "orbitalPeriod":
                properties.append(f"has an orbital period of {triple.object}")
            elif triple.predicate == "apoapsis":
                properties.append(f"has an apoapsis of {triple.object}")
