                properties.append(f" {triple.predicate} is {triple.object}")

        if properties:
            if len(properties) == 1:
                sentence += ", " + properties[0] + "."
            else:
                sentence += ", " + ", ".join(properties[:-1]) + ", and " + properties[-1] + "."
        else:
            sentence += "."
        combined_sentences.append(sentence)

    return " ".join(combined_sentences)

